  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`JSON(a.k.a JavaScript Object Notation) is a format for sharing data. A JSON object is a key-value data format that is typically rendered in curly braces. When you’re working with JSON, you’ll likely see JSON objects in a .json file, but they can also exist as a JSON object or string within the context of a program.`}</p>
    <p>{`Nested JSON is a JSON file with a big portion of its values being other JSON objects. Compared with Simple JSON, Nested JSON provides higher clarity in that it decouples objects into different layers, making it easier to maintain. `}</p>
    <h2 {...{
      "id": "example-of-nested-json-object"
    }}>{`Example of Nested JSON object`}</h2>
    <pre><code parentName="pre" {...{}}>{`employee = {
     'name': "Paul",
     'Age': '25',
     'Location': "USA",
     'Address':
        {
          "longitude": "-113.6335371",
          "latitude": "37.1049502",
          "postal code": "90266"
        }
   }
`}</code></pre>
    <p>{`Follow the below steps to understand how nested JSON objects can be imported into Redis database:`}</p>
    <h3 {...{
      "id": "step-1-run-redisjson-docker-container"
    }}>{`Step 1. Run RedisJSON Docker container`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` docker run -p 6379:6379 --name redis-redisjson redislabs/rejson:latest
`}</code></pre>
    <h3 {...{
      "id": "step-2-verify-if-redisjson-module-is-loaded"
    }}>{`Step 2. Verify if RedisJSON module is loaded`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli
 127.0.0.1:6379> info modules
 # Modules
 module:name=ReJSON,ver=10007,api=1,filters=0,usedby=[],using=[],options=[]
 127.0.0.1:6379> 
`}</code></pre>
    <h3 {...{
      "id": "step-3-nested-json"
    }}>{`Step 3. Nested JSON`}</h3>
    <p>{`Below is a python code for nested JSON document:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-python"
      }}>{` import redis
 import json

 employee = {
     'name': "Paul",
     'Age': '25',
     'Location': "USA",
     'Address': 
        {
          "longitude": "-113.6335371",
          "latitude": "37.1049502",
          "postal code": "90266"
        }
   }
 r = redis.StrictRedis()
 r.execute_command('JSON.SET', 'record', '.', json.dumps(employee))
 reply = json.loads(r.execute_command('JSON.GET', 'record'))
`}</code></pre>
    <p>{`Copy the code and save it in a file called `}<inlineCode parentName="p">{`employee.py`}</inlineCode></p>
    <h3 {...{
      "id": "step-4-load-redis-module"
    }}>{`Step 4. Load Redis Module`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` pip  install rejson
`}</code></pre>
    <h3 {...{
      "id": "step-5-execute-the-python-script"
    }}>{`Step 5. Execute the python script`}</h3>
    <p>{`Execute the below script and ensure that it executes successfully.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` python3 employee.py
`}</code></pre>
    <h3 {...{
      "id": "step-6-verify-the-json-objects-gets-added-to-redis"
    }}>{`Step 6. Verify the JSON objects gets added to Redis`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli
 127.0.0.1:6379> JSON.GET record
 "{\\"name\\":\\"Paul\\",\\"Age\\":\\"25\\",\\"Location\\":\\"USA\\",\\"Address\\":[{\\"longitude\\":\\"-113.6335371\\",\\"latitude\\":\\"37.1049502\\",\\"postal code\\":\\"90266\\"}]}"
`}</code></pre>
    <h3 {...{
      "id": "step-7-fetching-the-specific-fields"
    }}>{`Step 7. Fetching the specific fields`}</h3>
    <p>{`In case you want to fetch specific filed (like address), then the code would look like this:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-python"
      }}>{` import redis
 import json

 employee = {
     'name': "Paul", 
     'Age': '25', 
     'Location': "USA",
     'Address': 
        {
          "longitude": "-113.6335371",
          "latitude": "37.1049502",
          "postal code": "90266"
        }

  }
 r = redis.StrictRedis()
 r.execute_command('JSON.SET', 'record', '.', json.dumps(employee))
 reply = json.loads(r.execute_command('JSON.GET', 'record', '.Address.longitude'))
`}</code></pre>
    <h3 {...{
      "id": "step-8-verifying-the-results"
    }}>{`Step 8. Verifying the results`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`  redis-cli
  127.0.0.1:6379> JSON.GET record .Address.longitude
  "\\"-113.6335371\\""
`}</code></pre>
    <h3 {...{
      "id": "references"
    }}>{`References`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/using-nodejs"
        }}>{`Importing JSON data into Redis using NodeJS`}</a></li>
      <li parentName="ul">{`Learn more about `}<a parentName="li" {...{
          "href": "https://oss.redislabs.com/redisjson/"
        }}>{`RedisJSON`}</a>{` in the Quickstart tutorial.`}</li>
      <li parentName="ul"><a parentName="li" {...{
